window.bookSummaryJSON = "<p>All the pieces of the map are finally collected and assembled. Finley and her mates are hoping for a peaceful and eventful journey. Of course, that doesn't happen.</p> <p>Finley gets an unexpected surprise in the form of her mother and father, who are still alive. All they want is to follow the map and find the treasure, but that's hard to do when Finley's parents keep popping up at inopportune times.</p> <p>At least the angels are leaving them alone . . . right?</p> <p>As Finley, Stolas, Verkor, and Obsidian travel through the Heaven Realm, she learns a little more about herself and what happened in the past. Things come to a head with her parents and a fight breaks out. Once the dust settles, they continue on their journey and make a discovery of a lifetime.</p> <p>Now comes one of the biggest decisions of their lives: to rule or not to rule.</p> <p>Do they take the crown or run?</p> <p><b>Contains mature themes.</b></p>"; 
